import React from 'react';
import './index.css'

function Card(props){
    return(
    <div className='cards'>
    <div className='card'>
      <img className='card-img' src={props.imgsrc} alt='this is a picture'/>
      <div className='card-info'>
        <span className='card-dis'>{props.title}</span>
        <h2 className='card-title'>{props.sname}</h2>
        <a href={props.link} target="_blank">
        <button>watch now</button>
        </a>
      </div>
    </div>
  </div>
    );
  }

  export default Card
